import React, { Component } from "react";
import { Carousel } from "react-bootstrap";
import "./style.css";

export default class ProjectCard extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
                    <Carousel.Item className="projectCard" >
                        <img src={this.props.image} alt="project image" className="d-block w-100"/>
                        <Carousel.Caption>
                            <h3>
                            {this.props.name}
                            </h3>
                            <p>{this.props.description}</p>
                            <p>

                            </p>
                        </Carousel.Caption>

                        <Card.Text>
                            <a target ="_blank" href={this.props.ink}>
                                (GitHub Repo)
                            </a>
                            <a href={this.props.ink}>
                                (Deployed Application)
                            </a>
                        </Card.Text>
                    </Carousel.Item>
        )
    }
}
